import * as React from "react";

const gymMembersData = [
  {
    name: "Member 1",
    memberId: "SFM2301N1",
    sex: "W",
    dateEnrolled: "Jan 11",
    dateExpiration: "Feb 11",
    status: "inactive"
  },
  {
    name: "Member 2", 
    memberId: "SFM2301N2",
    sex: "M",
    dateEnrolled: "Jan 11",
    dateExpiration: "Feb 11",
    status: "active"
  }
];

const GymMember = ({ member }) => (
  <>
    <div className={`gym-member ${member.status}`}>
      <div className="member-info">
        <p className="member-name">{member.name}</p>
        <p className="member-id">{member.memberId}</p>
        <p className="member-sex">{member.sex}</p>
        <p className="member-enrolled-date">{member.dateEnrolled}</p>
      </div>
      <div className="member-actions">
        <p className="member-expiration-date">{member.dateExpiration}</p>
        <button className="edit-button">Edit</button>
      </div>
    </div>
  </>
);

const GymMembersList = () => (
  <div className="gym-members-list">
    {gymMembersData.map((member, index) => (
      <GymMember key={index} member={member} />
    ))}
  </div>
);

const Pagination = () => (
  <div className="pagination">
    <button className="previous-button">Previous</button>
    <button className="next-button">Next</button>
  </div>
);

function ActiveMembers() {
  return (
    <>
      <main className="active-members">
        <h1 className="page-title">Active Members</h1>
        <section className="filters">
          <div className="gym-members-filter">
            <h2 className="filter-title">Gym Members</h2>
            <div className="entities-filter">
              <span className="entities-label">Show Entities</span>
              <div className="entities-value">
                <span className="entities-number">10</span>
                <img src="https://cdn.builder.io/api/v1/image/assets/TEMP/1f8e126528d3a18a2f4379ab6c85fe99746d02a3b1621d5cb19c65b2ab7d4275?apiKey=dab1d767c7fa4022a44c79fa035746a8&" alt="" className="entities-icon" />
              </div>
            </div>
          </div>
          <div className="sex-filter">
            <span className="sex-label">Sexe</span>
            <div className="sex-value">
              <span className="sex-text">ALL</span>
              <img src="https://cdn.builder.io/api/v1/image/assets/TEMP/514ab2e6f7d74db4ab1d7d1316ca67f029fc64492f6f94aa26e6b9e56549b232?apiKey=dab1d767c7fa4022a44c79fa035746a8&" alt="" className="sex-icon" />
            </div>
          </div>
          <div className="search-filter">
            <button className="search-button">Search</button>
